import React, { useState } from 'react';
import './index.css';

const App = () =>{
    const [display,setValue]=useState('');
    const [fullname, setFullname]=useState('');
    const [displaytwo,setvaluetwo]=useState();
    const [lastnamenew, setvaluenew]=useState();

    const onSubmits = (event) =>{
        event.preventDefault();
        setFullname(display);
        setvaluenew(lastnamenew);
    };

    const Eventelement = (event) =>{
        console.log(event.target.value);
        setValue(event.target.value);
    };

    const Eventelementtwo = (event) =>{
        setvaluetwo(event.target.value);

    };
    return(
        <>
        <div>
            <form onSubmit={onSubmits}>
                <h1>Hello {fullname}</h1>
                <input type='text' placeholder='Enter Your Name' onChange={Eventelement} value={display}/>
                <br />
                <input type='text' placeholder='Enter Your LastName' onChange={Eventelementtwo} value={displaytwo}/>
                <br />
                <button type='submit'>Submit</button>
            </form>
        </div>
        </>
    );
}
export default App;
